import React, { useState } from 'react';
import { Provider as PaperProvider } from 'react-native-paper';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import { theme } from './src/core/theme';
import FastFoodBox from './src/screens/FastFoodBox'; // Import your FastFoodBox component
import Seller from './src/SFastfoods/Seller';

const Stack = createStackNavigator();

export default function App() {
  const [editableText, setEditableText] = useState('Your Initial Text'); // Initialize with the desired initial text

  return (
    <PaperProvider theme={theme}>
      <NavigationContainer>
        <Stack.Navigator
          initialRouteName="FastFoodBox"
          screenOptions={{
            headerShown: false,
          }}
        >
          <Stack.Screen
            name="FastFoodBox"
            options={{
              headerTitle: 'Fast Food Box',
            }}
          >
            {({ navigation }) => (
              <FastFoodBox
                editableText={editableText}
                setEditableText={setEditableText}
                navigation={navigation}
              />
            )}
          </Stack.Screen>
          <Stack.Screen name="Seller" component={Seller} />
        </Stack.Navigator>
      </NavigationContainer>
    </PaperProvider>
  );
}
